insert into plugin_contacts_contact (title,first_name,last_name,email,address1,address2,address3,address4,mobile,phone, notes, mailing_list)
(select distinct PG1Title, PG1FirstName, PG1LastName, PG1Email, PG1Add1, PG1Add2, PG1Add3, PG1Add4, PG1Mobile, PG1phone, concat('Emergency:', PG1EmergNo),@customer_list_id from import_student);
insert ignore into engine_users (`name`,surname,email,mobile,role_id,registered)
(select distinct PG1FirstName, PG1LastName, PG1Email, PG1Mobile, @pg_role_id, NOW() from import_student where PG1Email <> '');
insert into plugin_contacts_contact (title,first_name,last_name,email,mobile,phone, notes, mailing_list)
(select distinct PG2Title, PG2FirstName, PG2LastName, PG2Email, PG2Mobile, PG2phone,'',@customer_list_id from import_student where PG2FirstName <> '');
insert ignore into engine_users (`name`,surname,email,mobile,role_id,registered)
(select distinct PG2FirstName, PG2LastName, PG2Email, PG2Mobile, @pg_role_id, NOW() from import_student where PG2Email <> '');
insert into plugin_contacts_contact (first_name,last_name, notes, mailing_list, dob)
(select distinct FirstName, LastName,CONCAT_WS(' ','Active:', Active, 'Imported ID:', UserName, 'Famstud:', Famstud, 'Term:', Term),@student_list_id,STR_TO_DATE(DOB,'%d/%m/%Y') from import_student where FirstName <> '');
insert into plugin_contacts_has_relations (contact_1_id,contact_2_id,relation_id,deleted)
(select distinct student.id,pg1.id,1,0
insert into plugin_contacts_has_relations (contact_1_id,contact_2_id,relation_id,deleted)
(select distinct student.id,pg2.id,@pg_relation_id,0
