SELECT id INTO @trainer_list_id FROM plugin_contacts_mailing_list WHERE `name` = 'trainer';


CREATE TABLE `import_student` (
  `FirstName` varchar(255) DEFAULT NULL,
  `LastName` varchar(255) DEFAULT NULL,
  `ID` varchar(255) DEFAULT NULL,
  `PG1Title` varchar(255) DEFAULT NULL,
  `PG1FirstName` varchar(255) DEFAULT NULL,
  `PG1LastName` varchar(255) DEFAULT NULL,
  `PG1phone` varchar(255) DEFAULT NULL,
  `PG1Mobile` varchar(255) DEFAULT NULL,
  `PG1Add1` varchar(255) DEFAULT NULL,
  `PG1Add2` varchar(255) DEFAULT NULL,
  `PG1Add3` varchar(255) DEFAULT NULL,
  `PG1Add4` varchar(255) DEFAULT NULL,
  `PG1EmergNo` varchar(255) DEFAULT NULL,
  `PG1Email` varchar(255) DEFAULT NULL,
  `PG2Title` varchar(255) DEFAULT NULL,
  `PG2FirstName` varchar(255) DEFAULT NULL,
  `PG2LastName` varchar(255) DEFAULT NULL,
  `PG2Phone` varchar(255) DEFAULT NULL,
  `PG2Mobile` varchar(255) DEFAULT NULL,
  `PG2Email` varchar(255) DEFAULT NULL,
  `Active` varchar(255) DEFAULT NULL,
  `UserName` varchar(255) DEFAULT NULL,
  `PayCode` varchar(255) DEFAULT NULL,
  `Famstud` varchar(255) DEFAULT NULL,
  `DOB` varchar(255) DEFAULT NULL,
  `Term` varchar(255) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


select id into @customer_list_id from plugin_contacts_mailing_list l where l.`name`='Parent/Guardian';
select id into @student_list_id from plugin_contacts_mailing_list l where l.`name`='Student';
select id into @pg_role_id from engine_project_role r where r.role = 'Parent/Guardian';
select id into @pg_relation_id from plugin_contacts_relations where relation = 'Parent/Guardian';
select id into @courses_plugin_id_x from engine_plugins where `name` = 'courses';






	from plugin_contacts_contact student
		inner join import_student on student.first_name = import_student.FirstName and student.last_name = import_student.LastName
		inner join plugin_contacts_contact pg1 on import_student.PG1FirstName = pg1.first_name and import_student.PG1LastName = pg1.last_name and import_student.PG1Mobile = pg1.mobile);

	from plugin_contacts_contact student
		inner join import_student on student.first_name = import_student.FirstName and student.last_name = import_student.LastName
		inner join plugin_contacts_contact pg2 on import_student.PG2FirstName = pg2.first_name and import_student.PG2LastName = pg2.last_name and import_student.PG2Mobile = pg2.mobile);


