		inner join plugin_contacts_contact pg1 on import_student2.PG1Name = pg1.first_name and import_student2.PG1Mob = pg1.mobile);

	from plugin_contacts_contact student
		inner join import_student2 on student.first_name = import_student2.Name
		inner join plugin_contacts_contact pg2 on import_student2.PG2Name = pg2.first_name and import_student2.PG2Mob = pg2.mobile);

	from plugin_contacts_contact pg
		inner join engine_users u on pg.first_name = u.`name` and pg.last_name = u.surname and (pg.email = u.email or pg.mobile = u.mobile));
